import React from 'react';
import { useLocation } from 'react-router-dom';

export default function DividendResult() {
    const location = useLocation();
    const result = location.state;

    if (!result) return <div>결과 데이터가 없습니다.</div>;


    return (
        <div className="p-4">
        </div>
    );
}
